data.value:
Specifies a scriptblock that is executed when a terminating error is caught.
One or more exceptions can be specified to catch specific errors.

catch {}
catch <[ExceptionType1]>, <[ExceptionType2]> {}

Specifies a PowerShell class definition.

class <[ClassName]> {}
class <[ClassName]> : <[BaseClass1 or Interface1]>, <[Interface2]> {}

Defines a scriptblock that is restricted to a specified subset of the PowerShell language.

data {}
data <VariableName> {}
data -supportedCommand <Command1>, <Command2>

Specifies a scriptblock that is run once every time the script/function is executed.
The End block is executed after the Process block has finished processing incoming pipeline input.

end {}

Defines a PowerShell function where the default block is a Process block rather than an End block.

filter <FilterName> {param()}
filter <FilterName> {param() dynamicparam {} begin {} process {} end {} clean {}}

Defines a for loop.

for (<Initializer>;<Condition>;<AdvanceAction>;) {}
:label for (<Initializer>;<Condition>;<AdvanceAction>;) {}

Defines a foreach loop.

foreach (<CurrentItemVariable> in <Collection>) {}
:label foreach (<CurrentItemVariable> in <Collection>) {}

Defines a PowerShell function.

function <FunctionName> {param()}
function <FunctionName> {param() dynamicparam {} begin {} process {} end {} clean {}}

Defines a loop that evaluates the specified conditions for each item.

switch (<Collection>) {}
switch -OptionalParameters (<Collection>) {}
:label switch -OptionalParameters (<Collection>) {}

Defines either a While loop, or a condition for a Do loop.

while () {}
:label while () {}
do {} while ()
